module.exports = {"html":"<h1>QTMA Mood Journal</h1>\n<h2>Team Members</h2>\n<ul>\n<li>Shwetha Sivakumar</li>\n</ul>\n<h2>Problem statement</h2>\n<h2>Our solution</h2>\n<h2>Screenshot</h2>\n<p><img src=\"./public/demo.gif\" alt=\"\"></p>\n<h2>Requirements</h2>\n<ul>\n<li>Mac OS X, Windows, or Linux</li>\n<li><a href=\"https://yarnpkg.com/\">Yarn</a> package + <a href=\"https://nodejs.org/\">Node.js</a> v6.5 or newer</li>\n<li>Text editor or IDE pre-configured with React/JSX/Flow/ESlint (<a href=\"./how-to-configure-text-editors.md\">learn more</a>)</li>\n</ul>\n<h2>Directory Layout</h2>\n<p>Before you start, take a moment to see how the project structure looks like:</p>\n<pre><code>.\n├── /build/                     # The folder for compiled output\n├── /docs/                      # Documentation files for the project\n├── /node_modules/              # 3rd-party libraries and utilities\n├── /public/                    # Static files which are copied into the /build/public folder\n├── /src/                       # The source code of the application\n│   ├── /components/            # React components\n│   ├── /data/                  # GraphQL server schema and data models\n│   ├── /routes/                # Page/screen components along with the routing information\n│   ├── /client.js              # Client-side startup script\n│   ├── /config.js              # Global application settings\n│   ├── /server.js              # Server-side startup script\n│   └── ...                     # Other core framework modules\n├── /test/                      # Unit and end-to-end tests\n├── /tools/                     # Build automation scripts and utilities\n│   ├── /lib/                   # Library for utility snippets\n│   ├── /build.js               # Builds the project from source to output (build) folder\n│   ├── /bundle.js              # Bundles the web resources into package(s) through Webpack\n│   ├── /clean.js               # Cleans up the output (build) folder\n│   ├── /copy.js                # Copies static files to output (build) folder\n│   ├── /deploy.js              # Deploys your web application\n│   ├── /postcss.config.js      # Configuration for transforming styles with PostCSS plugins\n│   ├── /run.js                 # Helper function for running build automation tasks\n│   ├── /runServer.js           # Launches (or restarts) Node.js server\n│   ├── /start.js               # Launches the development web server with &quot;live reload&quot;\n│   └── /webpack.config.js      # Configurations for client-side and server-side bundles\n├── Dockerfile                  # Commands for building a Docker image for production\n├── package.json                # The list of 3rd party libraries and utilities\n└── yarn.lock                   # Fixed versions of all the dependencies\n</code></pre>\n<h2>Quick Start</h2>\n<h3>1. Get the latest version</h3>\n<p>You can start by cloning the latest version of this project on your\nlocal machine by running:</p>\n<pre><code class=\"language-shell\">$ git clone \\\n      git@github.com:hmeinertrita/MyPlanetGirlGuides.git\n$ cd MyPlanetGirlGuides\n</code></pre>\n<h3>2. Run <code>yarn install</code></h3>\n<p>This will install both run-time project dependencies and developer tools listed\nin <a href=\"../package.json\">package.json</a> file.</p>\n<h3>3. Run <code>yarn start</code></h3>\n<p>This command will build the app from the source files (<code>/src</code>) into the output\n<code>/build</code> folder. As soon as the initial build completes, it will start the\nNode.js server (<code>node build/server.js</code>) and <a href=\"https://browsersync.io/\">Browsersync</a>\nwith <a href=\"https://webpack.github.io/docs/hot-module-replacement\">HMR</a> on top of it.</p>\n<blockquote>\n<p><a href=\"http://localhost:3000/\">http://localhost:3000/</a> — Node.js server (<code>build/server.js</code>)\nwith Browsersync and HMR enabled<br>\n<a href=\"http://localhost:3000/graphql\">http://localhost:3000/graphql</a> — GraphQL server and IDE<br>\n<a href=\"http://localhost:3001/\">http://localhost:3001/</a> — Browsersync control panel (UI)</p>\n</blockquote>\n<p>Now you can open your web app in a browser, on mobile devices and start\nhacking away. Whenever you modify any of the source files inside the <code>/src</code> folder,\nthe module bundler (<a href=\"http://webpack.github.io/\">Webpack</a>) will recompile the\napp on the fly and refresh all the connected browsers.</p>\n<p>Note that the <code>yarn start</code> command launches the app in <code>development</code> mode,\nthe compiled output files are not optimized and minimized in this case.</p>\n<h2>Additional Resources</h2>\n<ul>\n<li><a href=\"http://facebook.github.io/react/\">Getting Started with React.js</a></li>\n<li><a href=\"http://redux.js.org/\">Getting Started Redux.js</a></li>\n<li><a href=\"https://github.com/kriasoft/universal-router\">About Universal-Router</a></li>\n<li><a href=\"http://stackoverflow.com/questions/tagged/reactjs\">React.js Questions on StackOverflow</a></li>\n<li><a href=\"https://discuss.reactjs.org/\">React.js Discussion Board</a></li>\n<li><a href=\"http://flowtype.org/\">Flow — A static type checker for JavaScript</a></li>\n<li><a href=\"https://github.com/reactjs/react-future\">The Future of React</a></li>\n<li><a href=\"https://babeljs.io/docs/learn-es6/\">Learn ES6</a>, <a href=\"https://github.com/lukehoban/es6features#readme\">ES6 Features</a></li>\n</ul>\n<hr>\n<p>Based off of the <a href=\"https://github.com/kriasoft/react-starter-kit\">react-starter-kit</a></p>\n<p>[rsk]: <a href=\"https://www.reactstarterkit.com\">https://www.reactstarterkit.com</a>\n<br>\n[demo]: <a href=\"http://demo.reactstarterkit.com\">http://demo.reactstarterkit.com</a>\n<br></p>\n"};

